function log(param: string) {
  return function(target: any, name: string, descriptor: PropertyDecorator) {
    console.log(target, name, descriptor)
  }
}
class Employee {
  @log('with param')
  routine() {
    console.log('Daily routine')
  }
}
const e = new Employee()
e.routine()
export {}
